function onCanvasChanged() {
    // canvas created or loaded or size changed, need to redraw contents
    var ctx = this.getContext("2d");
    if (ctx) {
        var extent = this.getExtent();
        ctx.save();
        ctx.setTransform(1, 0, 0, 1, 0, 0);
        this.draw(ctx, extent.x, extent.y);
        ctx.restore();
    }
}

