225.source:
function recordMouseEvent(evt) {
    if (!this.display) return;
    this.display.mouseX = evt.layerX;
    this.display.mouseY = evt.layerY;
    var buttons = this.display.buttons & 7;
    switch (evt.type) {
        case 'mousemove':
            return; // nothing more to do
        case 'mouseup':
            buttons = 0;
            break;
        case 'mousedown':
            // evt.which: 1 = left, 2 = middle, 3 = right
            // squeak: 4 = red, 2 = yellow, 1 = blue;
            switch (evt.which) {
                case 1: buttons = 4; break; // left -> red 
                case 2: buttons = 2; break; // middle -> yellow
                case 3: buttons = 1; break; // right -> blue
            }; 
            if (this.swapButtons)
                if (buttons == 2) buttons = 1; else
                if (buttons == 1) buttons = 2;
            break;
    }
    buttons +=
        (evt.shiftKey  ? 8  : 0) +   // Squeak.shift   = 8
        (evt.ctrlKey   ? 16 : 0) +   // Squeak.control = 16
        (evt.optionKey ? 32 : 0) +   // Squeak.option  = 32
        (evt.metaKey   ? 64 : 0);    // Squeak.command = 64
    if (!UserAgent.isMacOS && evt.altKey)
        buttons |= 64; // map ALT to CMD on non-Mac
    this.display.buttons = buttons;
    this.showMouseButtons();
}

