function doSwapButtons() {
    this.swapButtons = !this.swapButtons;
    var yellow = this.get("MiddleButton");
    var blue = this.get("RightButton");
    if (this.swapButtons) {var t = yellow; yellow = blue; blue = t};
    yellow.mask = 2;
    yellow.setFill(Color.rgb(255,255,128)); 
    blue.mask = 1;
    blue.setFill(Color.rgb(160,160,255)); 
    this.showMouseButtons();
}

241.source:
function onKeyDown(evt) {
    if (!this.display) return false;
    var code, modifier;
    switch (evt.getKeyCode()) {
        case Event.KEY_DELETE:    code = 127; break;
        case Event.KEY_BACKSPACE: code = 8; break;
        case Event.KEY_INSERT:    code = 5; break;
        case Event.KEY_TAB:       code = 9; break;
        case Event.KEY_RETURN:    code = 13; break;
        case Event.KEY_ESC:       code = 27; break;
        case Event.KEY_HOME:      code = 1; break;
        case Event.KEY_END:       code = 4; break;
        case Event.KEY_PAGEUP:    code = 11; break;
        case Event.KEY_PAGEDOWN:  code = 12; break;
        case Event.KEY_LEFT:      code = 28; break;
        case Event.KEY_RIGHT:     code = 29; break;
        case Event.KEY_UP:        code = 30; break;
        case Event.KEY_DOWN:      code = 31; break;
        case Event.KEY_SHIFT: modifier =  8; break;
        case Event.KEY_CTRL:  modifier = 16; break;
        case Event.KEY_CMD:   modifier = 64; break;
        // on non-Mac, map ALT to CMD
        case Event.KEY_ALT:   modifier = UserAgent.isMacOS ? 32 : 64; break;
    }
    if (code) { // special key pressed
        this.recordKeyboardEvent(code);
        evt.stop();
        return true;
    }
    if (modifier) { // modifier pressed
        this.display.buttons |= modifier;
        if (modifier > 8) // special
            this.display.keys = []; // flush queued key presses
        evt.stop();
        return true;
    }
    if (!this.isFocused()) return false;
    if (evt.isCommandKey()) { // clipboard requires special handling
        var c = evt.getKeyChar();
        switch(c && c.toLowerCase()) {
            // return false to let default handler do its magic
            case 'c': this.doKeyCopy(evt); return false;
            case 'v': this.doKeyPaste(evt); return false;
        }
    }
    // regular cmd keys. TODO: Windows/Linux?
    if ((evt.metaKey || evt.altKey) && evt.which) {
        code = evt.which;
        if (code >= 65 && code <= 90) {
            if (!evt.shiftKey) code += 32; // make lowercase
        } else {
            if (evt.keyIdentifier && evt.keyIdentifier.slice(0,2) == 'U+')
                code = parseInt(evt.keyIdentifier.slice(2), 16)
        }
        this.recordKeyboardEvent(code);
        evt.stop();
        return true;
    }
    return false;
}

