function onKeyUp(evt) {
    if (!this.display) return;
    var modifier;
    switch (evt.getKeyCode()) {
        case Event.KEY_SHIFT: modifier =  8; break;
        case Event.KEY_CTRL:  modifier = 16; break;
        case Event.KEY_CMD:   modifier = 64; break;
        // on non-Mac, map ALT to CMD
        case Event.KEY_ALT:   modifier = UserAgent.isMacOS ? 32 : 64; break;
    }
    if (modifier) {
        this.display.buttons &= ~modifier;
        if (modifier > 8) // special
            this.display.keys = []; // flush queued key presses
        evt.stop();
        return true;
    }
}

