255.source:
function doKeyCopy() {
    this.withClipboardEventDo(function(evt, data) {
        // simulate copy event for Squeak so it places its text in clipboard
        this.display.buttons &= ~Squeak.Keyboard_All;  // remove all modifiers
        this.display.buttons |= Squeak.Keyboard_Cmd;   // add cmd modifier
        this.display.keys = []; //  flush other keys
        this.recordKeyboardEvent('c'.charCodeAt(0)); // create cmd-c
        // now interpret until Squeak has copied to the clipboard
        this.display.clipboardStringChanged = false;
        var start = Date.now();
        while (!this.display.clipboardStringChanged && Date.now() - start < 500)
            this.display.vm.interpret(20);
        // got it, now copy to the system clipboard
        try {
            data.setData("Text", this.display.clipboardString);
        } catch(err) {
            show("display: copy error " + err);
        }
    }.bind(this));
}

