262.source:
function doKeyPaste() {
    this.withClipboardEventDo(function(evt, data) {
        try {
            this.display.clipboardString = data.getData('Text');
            // simulate paste event for Squeak
            this.display.buttons &= ~Squeak.Keyboard_All;  // remove all modifiers
            this.display.buttons |= Squeak.Keyboard_Cmd;   // add cmd modifier
            this.display.keys = []; //  flush other keys
            this.recordKeyboardEvent('v'.charCodeAt(0)); // create cmd-v
        } catch(err) {
            show("display: paste error " + err);
        }
    }.bind(this));
}

