269.source:
function recordKeyboardEvent(key) {
    var code = (this.display.buttons >> 3) << 8 | key;
    if (code === this.display.vm.interruptKeycode)
        this.display.vm.interruptPending = true;
    else
        this.display.keys.push(code);
}

