523.source:
function reset() {
    this.partsBinMetaInfo.requiredModules = [
        "users.bert.SqueakJS.vm",
        "users.bert.SqueakJS.ui",
    ];
    this.doNotSerialize.pushIfNotIncluded('vm');
    this.running = false;
    this.vm = null;
    this.byteCodeCount = 0;
    this.sendCount = 0;
    this.get("Tree").childrenPerPage = 10;
    this.get("Tree").setItem({
        name: 'no image loaded',
        style: {color: Color.web.darkgray}});
    this.get("Editor").doitContext = null;
    this.get("Editor").setTextString("this");
    this.get("VMState").setTextString("");
    this.get("Instructions").setTextString("");
    this.get("Display").onCanvasChanged();
}

