function onSelect(object) {
    var ed = this.get("Editor");
    if (object) {
        ed.doitContext = object;
        ed.textString = 'this // ';
        ed.textString += object.sqInstName();
    } else {
        ed.doitContext = this;
        ed.textString = 'this // the interpreter';
    }
}

