function interpretOne() {
    if (!this.vm) return this.loadMiniImage();
    this.running = false;
    //while (1 + this.vm.byteCodeCount < 138870) this.vm.interpretOne();
    this.vm.interpretOne();
    this.showVMState();
}

535.source:
function showVMState(blink) {
    this.get("VMState").setTextString(this.vm.printStack() + this.vm.printActiveContext());
    this.get("VMState").scrollToBottom();
    this.get("Editor").doitContext = this.vm;
    this.setTreeRoots("specialObjects", this.vm.image.specialObjectsArray,
        "activeContext", this.vm.activeContext);
    this.showInstructions();
    this.showBytecodes();
    // blink if process switch
    if (blink) {
        this.get("VMState").setFill(Color.yellow.lighter());
        this.get("VMState").withCSSTransitionDo(function(){
            this.setFill(Color.white);
        }, 500);
    }
}

538.source:
function showInstructions() {
    var instructions = this.vm.printByteCodes(this.vm.method, '   ', '=> ', this.vm.pc);
    var text = this.get("Instructions");
    var index = instructions.indexOf("=> ");
    text.setTextString(instructions);
    text.setSelectionRange(index, index+3);
    text.setScroll(0, text.getSelectionBounds().y - text.getExtent().y / 2);
    text.emphasizeRegex(/<[^>]*>/g, {color: Color.blue})
    text.emphasizeRegex(/=>[^\n]*\n/g, {backgroundColor: Color.rgb(195,249,231)});
}

541.source:
function loadImageFromBuffer(buffer, imageName, thenDo) {
    this.reset();
    this.get("Tree").setItem({name: 'loading ' + imageName + ' ...'});
    console.log('loading ' + imageName + ' (' + buffer.byteLength + ' bytes)');
    window.setTimeout(function() {
        var image;
        try {
            image = new users.bert.SqueakJS.vm.Image(buffer, imageName);
        } catch (e) {
            show(e);
        }
        var display = this.get("Display").createDisplay();
        this.vm = new users.bert.SqueakJS.vm.Interpreter(image, display);
        this.showVMState();
        if (thenDo) thenDo(this.vm);
    }.bind(this), 0);
}

