547.source:
function loadImage(url, thenDo) {
    //this.loadImage(Config.codeBase+"lib/squeak/mini.image")
    this.reset();
    this.get("Tree").setItem({name: 'loading image ...'});
    var rq = new XMLHttpRequest();
    rq.open('GET', url, true);
    rq.responseType = 'arraybuffer';
    rq.onload = function(e) {
        alertOK("downloaded image ("+rq.response.byteLength+" bytes)");
        //this.setMiniImage(new Uint32Array(rq.response));
        this.loadImageFromBuffer(rq.response, thenDo);
    }.bind(this);
    rq.send();
}

