553.source:
function makeTreeItem(label, object) {
    var self = this;
    var item = {
        doNotSerialize: ["object"],
        object: object,
        name: label + ": " +
            (object.sqInstName ? object.sqInstName() : object.toString()),
        children: !!object.pointers,
        onExpand: function(tree) {
            var n = 0;
            item.children = object.pointers.collect(function(child){
                return self.makeTreeItem(n+" ("+object.slotNameAt(++n)+")", child);
            });
        },
        onCollapse: function(tree) {
            item.children = true;      //release objects
        },
        onSelect: function(tree) {
            self.onSelect(object);
        }
    };
    if (object.bytes) item.description = "[" + object.bytes.length + " bytes]"; 
    if (object.words) item.description = "[" + object.words.length + " words]";
    return item;    
}

556.source:
function run(onBreakDo) {
    if (!this.running || !this.vm) return;
    // first, run the interpreter for a while
    var timeoutMs = this.vm.interpret(20);
    // if we hit a breakpoint, we're done
    if (timeoutMs === 'break') {
        this.running = false;
        if (onBreakDo) onBreakDo();
        else this.showVMState();
        return;
    }
    // otherwise, show the current bytecode
    this.get("Instructions").setTextString("#" + this.vm.sendCount);
    // and schedule us to run again
    window.setTimeout(function() {
        this.run(onBreakDo);
    }.bind(this), timeoutMs);
}

559.source:
function setTreeRoots(label, object, etc) {
    // this.setTreeRoots("specialObjects", this.vm.image.specialObjectsArray, "activeContext", this.vm.activeContext);
    var tree = this.get("Tree");
    var items = [];
    for (var i = 0; i < arguments.length; i += 2) {
        label = arguments[i];
        object = arguments[i+1];
        items.push(this.makeTreeItem(label, object))
    }
    if (items.length == 1) {
        tree.setItem(items[0]);
        tree.expand();
    } else {
        tree.setItem({children: items});
        tree.childNodes[tree.childNodes.length-1].expand();
    }
}

562.source:
function interpretOverSend() {
    if (!this.vm) return this.loadMiniImage();
    this.running = false;
    // if on a send, run until it returns 
    if (this.vm.willSendOrReturn()) {
        var ourContext = this.vm.activeContext;
        var ourSender = ourContext.pointers[Squeak.Context_sender];
        this.interpretTillSent(function thenDo() {
            if (this.vm.activeContext.pointers[Squeak.Context_sender] === ourContext)
                // we're in the child context, interpret to after return
                this.interpretTillReturned();
            else {
                // this is not the child context, might be process switch
                var blink = this.vm.activeContext !== ourContext
                    && this.vm.activeContext !== ourSender;
                this.showVMState(blink);
            }
        }.bind(this));
    } else { // otherwise, step to the next send
        while (!this.vm.willSendOrReturn()) this.vm.interpretOne();
        this.showVMState();
    }
}

565.source:
function interpret(onBreakDo) {
    if (!this.vm) return this.loadMiniImage(interpret.bind(this));
    if (this.running) {
        this.running = false;
        this.showVMState();
    } else {
        this.running = true;
        this.get('VMState').setTextString('');
        this.get('Instructions').setTextString('');
        this.get('Tree').setItem({name: 'running'});
        this.run(onBreakDo);
    }
}

568.source:
function interpretTillReturned(thenDo) {
    if (!this.vm) return this.loadMiniImage();
    this.running = false;
    this.vm.breakOnReturn();
    var ourSender = this.vm.activeContext.pointers[Squeak.Context_sender];
    this.interpret(function onBreakDo() {
        // blink if context is not our sender
        this.showVMState(this.vm.activeContext !== ourSender);
        if (thenDo) thenDo();
    }.bind(this));
}

571.source:
function interpretTillSent(thenDo) {
    if (!this.vm) return this.loadMiniImage();
    this.running = false;
    this.vm.breakOnSendOrReturn();
    var ourContext = this.vm.activeContext;
    var ourSender = ourContext.pointers[Squeak.Context_sender];
    this.interpret(function onBreakDo() {
        // blink if context is not a child or sender
        var blink = this.vm.activeContext.pointers[Squeak.Context_sender] !== ourContext
            && this.vm.activeContext !== ourContext
            && this.vm.activeContext !== ourSender;
        this.showVMState(blink);
        if (thenDo) thenDo();
    }.bind(this));
}

574.source:
function showBytecodes() {
    var bytecodes = this.vm.byteCodeCount - this.byteCodeCount;
    var sends = this.vm.sendCount - this.sendCount;
    if (bytecodes) {
        var ed = this.get("Editor");
        var string = bytecodes + " bytecode";
        if (bytecodes > 1) string += "s";
        if (sends) string += ", " + sends+ " send";
        if (sends > 1) string += "s";
        string += " (#"+ this.vm.byteCodeCount+")";
        ed.setTextString(ed.getTextString()+'\n'+string);
        ed.scrollToBottom();
    }
    this.byteCodeCount = this.vm.byteCodeCount;
    this.sendCount = this.vm.sendCount;
}
